import '../CSS/Menu.css';
import MenuItem from './MenuItem';

function Menu(props) {
     const database = props.database;

     const displayMenuItem = () => {
          database.map((item) => <div>{MenuItem(item)}</div>);
     };

     return <div className='menu_list'>{displayMenuItem()}</div>;
}

export default Menu;
